IF OBJECT_ID('dbo.proc_transform_233', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_233;
GO
CREATE PROCEDURE dbo.proc_transform_233
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_233
    SET payload = LEFT(payload, 1000) + N'|V4-233|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_233;
END
